import { createStore } from 'vuex';

const store = createStore({
  state() {
    return {
        FormComponent:{
            Tipo: ''
        }

    };
  },
  mutations: {
    setProps(state, props) {
      state.Tipo = props.Tipo
    },
  },
});

export default store;
